import { Dimensions, Text } from 'react-native';
import { bloodSugarGraph } from '../style/style';
import Svg, { Path } from 'react-native-svg';
import { parseISO } from 'date-fns'
import * as d3 from 'd3';
import { Data } from './Data.js';

export default () => {
  const sugarData = [95, 99, 112];
  let yHideRatio = 0.8;
  let defaultMax = 250;

  const vw = Dimensions.get("window").width;

  for (let i = 0; i < Data.length; i++) {
    Data[i][0] = parseISO(Data[i][0]);
  }

  const width = vw * .6;
  const height = width;

  const xAxis = d3.scaleLinear()
    .domain([new Date(Data[0][0]), new Date(Data[Data.length - 1][0])])
    .range([0, width]);

  const yAxis = d3.scaleLinear()
    .domain(d3.extent(Data.map((i) => i[1])))
    .range([height, 0]);

  const line = d3.line()
    .x(i => xAxis(i[0]))
    .y(i => yAxis(i[1]))
  let graph = line(Data);

  console.log(graph);

  return (
    <View style={bloodSugarGraph.container}>
      <Svg
        width={width}
        height={height}
        xmlns="http://www.w3.org/2000/svg"
      >
        <Path
          fill="none"
          stroke="red"
          strokeWidth={5}
          d={graph}
        />
      </Svg>
    </View>
  );
}
